import React from 'react';

function Backdrop(props) {

  const handleKeyDown = (event) => {
    if (event.key ===  'Enter' || event.key === " ") {
      props.onExit();
    }
  };

  return (
    <div
      className='backdrop'
      onClick={props.onExit}
      onKeyDown={handleKeyDown}
      tabIndex='0'
      role='button'
      aria-label='Close'
    ></div>
  );
}
export default Backdrop;
